package advent2021

import (
	"fmt"
	"github.com/stretchr/testify/assert"
	"testing"
)

type strat struct {
	opponent string
	player   string
}

func TestDayTwo2021PartOneExample(t *testing.T) {

	input := []strat{{"A", "Y"}, {"B", "X"}, {"C", "Z"}}

	actual := playRps(input)
	expected := 15

	assert.Equal(t, expected, actual)
}

func playRps(strats []strat) int {
	totPoints := 0
	for k, s := range strats {
		points := rps(s.opponent, s.player)
		fmt.Printf("Round #%d -> %v = %d\n", k, s, points)
		totPoints += points
	}

	return totPoints
}

var playerRules = map[string]int{"AX": 3, "AY": 6, "AZ": 0, "BX": 0, "BY": 3, "BZ": 6, "CX": 6, "CY": 0, "CZ": 3}

// The score for a single round is the score for the shape you selected (1 for Rock, 2 for Paper, and 3 for Scissors)
// plus the score for the outcome of the round (0 if you lost, 3 if the round was a draw, and 6 if you won).

// Opponent: A for Rock, B for Paper, and C for Scissors.
// Player: X for Rock, Y for Paper, and Z for Scissors
func rps(opponent string, player string) int {

	return calcBaseScore(player) + playerRules[opponent+player]
}

func calcBaseScore(player string) int {
	switch player {
	case "X":
		return 1
	case "Y":
		return 2
	case "Z":
		return 3
	}
	return -1000000
}

