// X means you need to lose, Y means you need to end the round in a draw, and Z means you need to win.
var playerCheat = map[string]string{"AX": "Z", "AY": "X", "AZ": "Y", "BX": "X", "BY": "Y", "BZ": "Z", "CX": "Y", "CY": "Z", "CZ": "X"}

func cheatRps(strats []strat) interface{} {
	totPoints := 0
	for k, s := range strats {
		cheat := playerCheat[s.opponent+s.player]
		points := rps(s.opponent, cheat)
		fmt.Printf("Round #%d -> {%s, (%s -> %s)} = %d\n", k, s.opponent, s.player, cheat, points)
		totPoints += points
	}

	return totPoints
}

